import React from 'react';
import {Card} from 'react-bootstrap';

const Idea = ({datos}) => {
  return (
  <div >
      <>
     
        <Card
          bg={'Info'}
          key={'Info'}
          text={'dark'}
          className="mb-2"
        >
          <Card.Header>{datos.idea}</Card.Header>
          <Card.Body>
            <Card.Text>
            {datos.description}
            </Card.Text>
            <footer className="blockquote-footer">
           Author: <cite title="Source Title">{datos.author.name}</cite>
          </footer>
          </Card.Body>
        </Card>
      
    </>
    <div key={datos._id}>
    <h1>{datos.idea}</h1>
    <h2 className='text-secondary text-opacity-75 fs-5'>Descripcion: {datos.description}</h2>
    <p>Autor: {datos.author.name}</p>
    </div>
  
  </div>
 
    )
}

export default Idea
